import React, {Component} from "react";
import background from "../images/bg.png"

class NavBar extends Component{
    render(){
        return(
            <div className="has-bg-img">
                <img src={background} className="bg-img img-responsive"></img>
                
            </div>
        );
    }
}

export default NavBar
